/*
@肥皂  7.13 东风雪铁龙 积分兑换实物
完成评论任务
抓取域名 gateway-sapp.dpca.com.cn
变量 dfxtlapp  抓取账号请求头Authorization的值就可以
变量 dfxtlplnr  评论帖子的内容（建议自定义设置一下，防止重复内容太多）这个变量别分割，没做多账户处理
变量 cdkey    脚本通用卡密
多账号@分割
一天1-2次吧。

7.21重要更新，更新为账户密码登录，这样可以解决token七天过期的问题。
抓包 https://gateway-sapp.dpca.com.cn/api-u/v1/user/auth/loginForPwd 请求的password值（密码）
密码自己下载东风雪铁龙app去设置密码，然后登录就能抓到这个包了。多号建议密码设置一样。抓一个就行了
变量 dfxtlplnr  自定义评论内容，增加了多账号处理，@分割每个账号的评论内容
*/
